import { type ClassValue, clsx } from "clsx"
import { isWeekend, addDays, format } from 'date-fns';
import { ptBR } from "date-fns/locale";
import { twMerge } from "tailwind-merge"

export function cn(...inputs: ClassValue[]) {
  return twMerge(clsx(inputs))
}

export function formatarMoeda(valor:any) {
  const valorFormatado = valor.toLocaleString('pt-BR', {
      style: 'currency',
      currency: 'BRL',
  });
  return valorFormatado;
};

const obterProximoDiaUtil = (data:any) => {
  if (isWeekend(data)) {
    // Se a data for final de semana, adicione os dias necessários para obter o próximo dia útil
    return addDays(data, data.getDay() === 5 ? 2 : 1); // Se for sexta-feira, adicione 2 dias, senão adicione 1 dia
  }

  // Se não for final de semana, retorne a data original
  return data;
};
export default obterProximoDiaUtil;

/**
 * 
 * @param data yyyy-MM-dd
 * @returns dd/MM/yyyy
 */
export function formatarData(data:string) {
  //const dataSelecionada = new Date(data);

  const [ano, mes, dia] = data.split('-').map(String);

  const dataFormatada = `${dia}-${mes}-${ano}`;

  return  dataFormatada;

}

export function formatDateToString(date:Date){
  return format(formatUtcDate(date), 'dd-MM-yyyy', { locale: ptBR });
};

export function formatUtcDate(date:Date){
  return new Date(
    date.getUTCFullYear(),
    date.getUTCMonth(),
    date.getUTCDate(),
    date.getUTCHours(),
    date.getUTCMinutes(),
    date.getUTCSeconds()
  );
};

export function formatarDataOnchange(input:any) {

  let valor = input.replace(/\D/g, ''); // Remove todos os caracteres não numéricos
  let dataFormatada = '';

  if (valor.length > 2) {
    dataFormatada += valor.substring(0, 2) + '-';
    valor = valor.substring(2);
  }

  if (valor.length > 2) {
    dataFormatada += valor.substring(0, 2) + '-';
    valor = valor.substring(2);
  }

  dataFormatada += valor;

  return dataFormatada;
}


